            "CH": "从一道光开始。<br>祂们坠落，陨灭的威胁居高临下。<br>祂们不得不停止自我复制，争先恐后拥抱彼此，<br>试图用繁殖的权利为代价，换取生存的可能。<br>祂们携手，从未如此团结<br>——但命途戛然而止，<br>祂们趋向真正的死亡。",
