            "CH": "少女躲在门后，不敢再靠前一步。<br>或许是因为今夜的目标就在眼前，她反而有些心跳加速。<br>「不怕不怕，我不怕……」<br>黑暗中，沉默放声尖叫。<br><br>少女颤抖着，捏紧了手里的「武器」，却依然不敢靠近「目标」。<br>「没什么好害怕…好…好害怕！」<br><br>身后的尾巴终于忍受不住，骤然亮起。<br>「快点啊，你就是拿个快递而已！」",
