            "CH": "<i>「输了想哭就哭吧，杰帕德。」<br>「但哭着也要站起来，直到你能赢过我…无论需要五年还是十年。」</i><br>几年后，小男孩不再哭鼻子，也不再输给姐姐。<br><br>如今在战场上，无论以何种姿态，骁勇无畏的银鬃铁卫戍卫官总会坚守至最后<br>——只为找到彻底摧毁敌人的一瞬。",
