            "CH": "<i>「记住，和那些怪物的战争，是不能靠撤退打赢的。」<br>「我们的身后就是贝洛伯格，我们就是最后一道钢铁防线，……」<br>「只有我们，绝不能退！」</i><br><br>她抬起头，前方是寒天，是冻土，是一望无际的风雪。<br>一切如常。<br>唯独那个她一直注视着的背影，不在了。",
