        "Desc": {
            "CH": "<i>「东西到手了，交给你断后咯。」</i><br>通讯器里传来同伴的声音。<br><br>他看向周围，废弃的巨型建筑内，残存的敌人仍在复杂的结构中穿行，向他逼近。<br><i>「稍等片刻。」</i><br><br>一瞬寂静之后，宛如末日灾难的剧烈爆炸冲天而起。气浪吹起尘埃，烟云四散，致人目盲的强光令夜空亮如白昼。<br><i>「你知道那里面都是他们故意设置的火药吧？」</i><br><br>斗篷猎猎张开，他如同完成了一场悠闲散步。<br><i>「当然。」</i><br><i>「所以点燃他们，我只需当那根火柴就好。」</i>",
            "EN": "<i>\"Package secured. I'll leave covering our retreat to you.\"</i><br>His comrade's voice comes through the communicator.<br><br>He glances around his surroundings, watching as the savaged remnants of his enemies continue to pass through the complex architecture inside the vast and abandoned structure. They are drawing ever closer.<br><i>\"Please hold.\"</i><br><br>After a beat of quietude, a series of apocalyptic explosions rocket up into the sky. Waves of displaced air cast clouds of dust high across the battlefield, and smoke scatter in all directions, the blinding white cleaving light into the night.<br><i>\"You know they purposely planted loads of gunpowder in there, right?\"</i><br><br>With a rustle, he flung open his cape as if he just finished a leisurely stroll.<br><i>\"Of course.\"</i><br><i>\"So, let's light it up. All I need to do is play the part of the match.\"</i>"
        },
