            "CH": "她曾怀疑那是某种程式，不然怎会不知疲倦。<br>但程式不会主动舍弃最优方案，绕过她布下的陷阱。<br><br><i>「看来我们要打一场持久战。」</i><br>她打了个哈欠。<br><br><i>「早点睡吧，有机生命应当珍惜梦境。」</i><br>周围暗了下去。<br><br>她突然惊醒，但数据的残渣已被扫去，烧毁，好像一场梦<br>——除了那初尝失败的滋味是如此真实。",
