            "CH": "上路时，她仍然对这趟远行一无所知。<br>只知道终于能告别家中的百舌之声，躲避无处不在的明枪暗箭。<br>直到她望向窗外时，她终于明白了那首诗的意味。<br><i>「在某个时刻之后，我们不再行走，而是飞翔。」</i><br><br>而她眼中闪动的亮光，正是行星的倒影。",
