            "CH": "少女不解地比划着手中的细剑。<br>自己的剑要双手才能挥舞，这样的剑也能算剑？这样的剑也能杀敌？<br><br>剑的主人倒是对此毫不在意，毕竟——<br>杀不杀敌又不在剑，全在心。<br>用的重剑还是细剑，又有什么区别。",
