            "CH": "医生找到女孩时，她受了伤，却仍紧紧抱着停止运转的机器，口袋里装满了翻找来的各种零件。<br>她赶紧把女孩带回了诊所，给伤口上好药。<br>汗珠从脸颊旁滑落，女孩虽然一言不发，手却一刻不停。<br>医生知道，此时女孩的眼中只有那台机器，就像自己面对着等待救治的病人。<br>因此她没有出声安慰，也没有提醒她往后要小心一些，只是坐在女孩身边，静静陪伴着她。",
            "EN": "When the doctor found the wounded girl, she was clinging to a machine that had stopped working, with all sorts of parts filling her pocket.<br>She took the girl back to her clinic and treated the wounds.<br>Drops of sweat slowly rolled down the girl's cheek, but she remained silent and her hands didn't stop fiddling the machine.<br>To the doctor, the way the girl was attached to the machine was very much like how she was attached to her patients who needed help.<br>So the doctor did not try to comfort the girl nor did she nag her about being more careful; but rather, she sat down with her to give her a moment of peace."
