            "CH": "刚开始，它和上一幅画像中的姿势完全一致。<br>她看着这张和自己一模一样的脸，认定这还不是她。<br><br><i>「世上怎么可能会有两幅相同的画像呢？」</i><br><br>她摆弄着它的关节，教它睁开眼，教它的手指变得更柔软。<br>她满意地住了手。<br><br><i>「和昨天截然不同，这才是今天的我。」</i>",
